function SensorConfigurationPage() {
    /**
     *
     */
    SensorConfigurationPage.prototype.initialize = function (console, sensor) {
        this.id = "sensorConfiguration";
        this.console = console;
        this.sensor = sensor;

        return this;
    };

    /**
     *
     */
    SensorConfigurationPage.prototype.show = function () {
        var deferred = $.Deferred();

        deferred.resolve();

        return deferred.promise();
    };

    /**
     *
     */
    SensorConfigurationPage.prototype.leave = function () {
    };
}
